// SPDX-License-Identifier: MIT
pragma solidity >=0.8.9; // >=0.8.0 has SafeMath built-in

import "./FlightSuretyData.sol";


/************************************************** */
/* FlightSurety Smart Contract                      */
/************************************************** */
contract FlightSuretyApp {

    /********************************************************************************************/
    /*                                       DATA VARIABLES                                     */
    /********************************************************************************************/
	FlightSuretyData flightSuretyData;
	address private contractOwner; // address used to deploy contract
	bool private operational = true;
	address[] private multiCalls = new address[](0);


	// 										EVENT DEFINITIONS:
	event AirlineRegistered(address addr);
	event AirlineFunded(address addr);
	event FlightRegistered(address airline, string flight, uint256 timestamp);
	event InsuranceBought(
		address airline,
		string flight,
		uint256 timestamp,
		address passenger,
		uint256 amount
	);
	event AccountWithdrawn(address passenger, uint256 amount);	


    /********************************************************************************************/
    /*                                       FUNCTION MODIFIERS                                 */
    /********************************************************************************************/

    // Modifiers help avoid duplication of code. They are typically used to validate something
    // before a function is allowed to be executed.

	modifier requireIsOperational() {
		require(operational, "Contract currently not operational");
		_; //modifiers require '_' which indicates where the function body will be included at
	}

    modifier requireContractOwner() {
		require(msg.sender == contractOwner, "Caller is not contract owner");
		_;
	}

	modifier requireIsAirline() {
		require(
			flightSuretyData.isAirline(msg.sender),
			"Caller is not a registered airline"
		);
		_;
	}

	modifier requireIsFundedAirline() {
		require(
			flightSuretyData.isFundedAirline(msg.sender),
			"Caller is not a funded airline"
		);
		_;
	}

	modifier requireIsValid(address addr) {
		require(addr != address(0), "Address cannot be 0x0");
		_;
	}

		modifier requireIsFlight(
			address airline,
			string memory flight,
			uint256 timestamp
		) {
			require(
				!flightSuretyData.isFlight(airline, flight, timestamp),
				"Flight not registered"
			);
			_;
		}	

	modifier requireIsNotLandedFlight(
		address airline,
		string memory flight,
		uint256 timestamp
	) {
		require(
			!flightSuretyData.isLandedFlight(airline,flight,timestamp),
			"Flight landed"
		);
		_;
	}

	modifier requireIsNotInsuredFlight(
		address airline,
		string memory flight,
		uint256 timestamp
	) {
		require(
			!flightSuretyData.isInsured(msg.sender, airline, flight, timestamp),
			"Insurance for flight has already been purchased"
		);
		_;
	}

    /********************************************************************************************/
    /*                                       CONSTRUCTOR                                        */
